import React from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav, Container, Form, FormControl } from "react-bootstrap";
import { FaSirenOn } from "react-icons/fa6"; // ðŸš¨ Import ambulance siren icon

const AppNavbar = () => {
  return (
    <Navbar expand="lg" style={{ backgroundColor: "#ffcccc" }} variant="light">
      <Container>

        {/* Left - Icon + Title */}
        <Navbar.Brand as={Link} to="/home" className="d-flex align-items-center">
          <FaSirenOn className="me-2" color="#b22222" size={24} />
          <span style={{ fontWeight: "bold", color: "#b22222" }}>Emergency System</span>
        </Navbar.Brand>

        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">

          {/* Center - Search bar */}
          <Form className="mx-auto w-50 d-flex">
            <FormControl type="search" placeholder="Search" className="me-2" />
          </Form>

          {/* Right - Nav links */}
          <Nav className="ms-auto">
            <Nav.Link as={Link} to="/home">Home</Nav.Link>
            <Nav.Link as={Link} to="/register">Register</Nav.Link>
            <Nav.Link as={Link} to="/profile">My Profile</Nav.Link>
          </Nav>

        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default AppNavbar;
